ule -->\n\nCommonModule->TsInputModule\n\n\n\nTsInputMessagesModule -->\n\nCommonModule->TsInputMessagesModule\n\n\n\nTsMenuModule -->\n\nCommonModule->TsMenuModule\n\n\n\nTsSelectModule -->\n\nCommonModule->TsSelectModule\n\n\n\nTsSearchModule -->\n\nCommonModule->TsSearchModule\n\n\n\n\n\nLaddaModule.forRoot(args)\n\nLaddaModule.forRoot(args)\n\nTsButtonModule -->\n\nLaddaModule.forRoot(args)->TsButtonModule\n\n\n\n\n\nMdButtonModule\n\nMdButtonModule\n\nTsButtonModule -->\n\nMdButtonModule->TsButtonModule\n\n\n\n\n\nMdIconModule\n\nMdIconModule\n\nTsButtonModule -->\n\nMdIconModule->TsButtonModule\n\n\n\nTsInputModule -->\n\nMdIconModule->TsInputModule\n\n\n\nTsInputMessagesModule -->\n\nMdIconModule->TsInputMessagesModule\n\n\n\nTsMenuModule -->\n\nMdIconModule->TsMenuModule\n\n\n\n\n\nFormsModule\n\nFormsModule\n\nTsInputModule -->\n\nFormsModule->TsInputModule\n\n\n\nTsInputMessagesModule -->\n\nFormsModule->TsInputMessagesModule\n\n\n\nTsSelectModule -->\n\nFormsModule->TsSelectModule\n\n\n\nTsSearchModule -->\n\nFormsModule->TsSearchModule\n\n\n\n\n\nMdInputModule\n\nMdInputModule\n\nTsInputModule -->\n\nMdInputModule->TsInputModule\n\n\n\nTsInputMessagesModule -->\n\nMdInputModule->TsInputMessagesModule\n\n\n\n\n\nMdMenuModule\n\nMdMenuModule\n\nTsMenuModule -->\n\nMdMenuModule->TsMenuModule\n\n\n\n\n\nMdSelectModule\n\nMdSelectModule\n\nTsSelectModule -->\n\nMdSelectModule->TsSelectModule\n\n\n\n\n\n\n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n    \n            \n                \n                    \n                        \n                        \n                            7 modules\n                        \n                    \n                \n            \n            \n                \n                    \n                        \n                        6 components\n                    \n                \n            \n            \n                \n                    \n                        \n          